import React, { useState } from "react";
import CollapseButton from "./custom controls/buttons/CollapseButton";
import { 
  DocumentIcon, PlusCircleIcon, EyeIcon, ExclamationCircleIcon, 
  BellIcon, DocumentTextIcon, UserCircleIcon, TableIcon 
} from "@heroicons/react/24/solid";

export default function SideBar() {
  const [isOpen, setIsOpen] = useState(true); // Sidebar state
  const [openList, setOpenList] = useState(""); // Submenu state

  const handleListClick = (listName) => {
    setOpenList((prevList) => (prevList === listName ? "" : listName));
  };

  const toggleStatSidebar = () => {
    if (isOpen) {
      setOpenList(""); }
    setIsOpen(!isOpen);
  };

  return (
    <div className={`relative flex flex-col h-screen ${isOpen ? "w-64" : "w-16"} bg-blue-500 p-4 text-white transition-width duration-300`}>
      {/* Sidebar collapse button */}
      <CollapseButton
        isOpen={isOpen}
        setIsOpen={toggleStatSidebar} // Custom toggle function
        Orientation={"horizontal"}
      />

      <ul className="flex flex-col mt-6 space-y-4">
        {/* Document Requests */}
        <li className="flex items-center px-6 py-3 cursor-pointer bg-blue-500 hover:bg-blue-600 rounded-lg relative">
          <div className="flex items-center space-x-3">
            <DocumentIcon className="h-6 w-6 text-white" />
            {isOpen && <span className="text-lg font-medium">Document Requests</span>}
          </div>
        </li>

        {/* Visual Requests */}
        <li className="flex items-center px-6 py-3 cursor-pointer bg-blue-500 hover:bg-blue-600 rounded-lg relative">
          <div className="flex items-center space-x-3">
            <EyeIcon className="h-6 w-6 text-white" />
            {isOpen && <span className="text-lg font-medium">Visual Requests</span>}
          </div>
        </li>

        {/* Additional Requests */}
        <li className="flex items-center px-6 py-3 cursor-pointer bg-blue-500 hover:bg-blue-600 rounded-lg relative">
          <div className="flex items-center space-x-3">
            <PlusCircleIcon className="h-6 w-6 text-white" />
            {isOpen && <span className="text-lg font-medium">Additional Requests</span>}
          </div>
        </li>

        {/* View Demand Processing */}
        <li className="flex items-center px-6 py-3 cursor-pointer bg-blue-500 hover:bg-blue-600 rounded-lg relative">
          <div className="flex items-center space-x-3">
            <DocumentTextIcon className="h-6 w-6 text-white" />
            {isOpen && <span className="text-lg font-medium">View Demand Processing</span>}
          </div>
        </li>

        {/* Manage Student Accounts */}
        <li className="flex items-center px-6 py-3 cursor-pointer bg-blue-500 hover:bg-blue-600 rounded-lg relative">
          <div className="flex items-center space-x-3">
            <UserCircleIcon className="h-6 w-6 text-white" />
            {isOpen && <span className="text-lg font-medium">Manage Student Accounts</span>}
          </div>
        </li>

        {/* Detailed Requests Display */}
        <li className="flex items-center px-6 py-3 cursor-pointer bg-blue-500 hover:bg-blue-600 rounded-lg relative">
          <div className="flex items-center space-x-3">
            <EyeIcon className="h-6 w-6 text-white" />
            {isOpen && <span className="text-lg font-medium">Detailed Requests Display</span>}
          </div>
        </li>

        {/* Report Problem */}
        <li className="flex items-center px-6 py-3 cursor-pointer bg-blue-500 hover:bg-blue-600 rounded-lg relative">
          <div className="flex items-center space-x-3">
            <ExclamationCircleIcon className="h-6 w-6 text-white" />
            {isOpen && <span className="text-lg font-medium">Report Problem</span>}
          </div>
        </li>

        {/* Announcements */}
        <li className="flex items-center px-6 py-3 cursor-pointer bg-blue-500 hover:bg-blue-600 rounded-lg relative">
          <div className="flex items-center space-x-3">
            <BellIcon className="h-6 w-6 text-white" />
            {isOpen && <span className="text-lg font-medium">Announcements</span>}
          </div>
        </li>
      </ul>
    </div>
  );
}
